import React, { useEffect } from "react";
import { connect } from "react-redux";

import Grid from "@material-ui/core/Grid";

import ClassificadoItem from "../classificado-item/classificado-item";

import { fetchClassificadosStart } from "../../redux/classificado/classificado.actions";

const ClassificadoList = ({ fetchClassificadosStart }) => {
  useEffect(() => {
    fetchClassificadosStart();
  }, [fetchClassificadosStart]);

  return (
    <div className="classificado-list">
      <Grid container spacing={1}>
        <ClassificadoItem />
      </Grid>
    </div>
  );
};

const mapDispatchToProps = (dispatch) => ({
  fetchClassificadosStart: () => dispatch(fetchClassificadosStart()),
});

export default connect(null, mapDispatchToProps)(ClassificadoList);
